import styled from 'styled-components';

export const NavBarWrapper = styled.div`
    width: 100%;
    height: 35px;
    background-color: #c20c0c;
`

export const CategoryList = styled.ul`
    width: 1100px;
    margin: 0 auto;
    display: flex;

    .item{
        height: 35px;
        line-height: 35px;
        text-align: center;
    }
`
